import { Grid, GridItem } from "components";
import { Link } from "react-router-dom";

export const CountryList = ({ countries }) => {
  return (
    <Grid>
      {countries.map((country) => (
        <GridItem>
          <Link>
            <img src={country.flag} alt={country.country} />
          </Link>
        </GridItem>
      ))}
    </Grid>
  );
};
